import React, { Component } from 'react';
import './Memo.css';

export default class Memo extends Component {
    render() {
        let _onClickMemoVideoTime = (e) => {
            e.preventDefault();
            const memoList = document.getElementById("memoList")
            if(memoList.value !== "")
                memoList.value.seekTo(191);
        }

        let memo = this.props.memo;
        return(
            <div className="Memo">
              <div className="MemoTitle">{memo.memoTitle}</div>
              <div className="MemoDescc">{memo.memoContent}</div>
              <a href="/content" className="MemoVideoTime" onClick={_onClickMemoVideoTime} value={memo._onClickMemoVideoTime}>
                  <div >{`${Number.parseInt(memo._onClickMemoVideoTime/60)}:${memo._onClickMemoVideoTime%60}`}</div>
            </a>
            </div>
        )
    }
}
